import java.util.Scanner;

public class P4_Chu_Ashley_CheckMail {
    
    
    public static void main(String[] args) {
        double side1;
        double side2;
        double side3;
        double longestSide;
        double girth;
        
        double weight;
        
        //get data from the user
        Scanner s = new Scanner(System.in);
        System.out.println("Enter the length of side1 of the package: ");
        side1 = s.nextDouble();
        System.out.println("Enter the length of side2 of the package: ");
        side2 = s.nextDouble();
        System.out.println("Enter the length of side3 of the package: ");
        side3 = s.nextDouble();
        System.out.println("Enter the weight of the package: ");
        weight = s.nextDouble();
        
        //longest of dimensions and girth
        if (side1 >= side2 && side1 >= side3) {
            longestSide = side1;
            girth = side2 * 2 + side3 * 2;
        } else if (side3 >= side2 && side3 >= side1) {
            longestSide = side3;
            girth = side2 * 2 + side1 * 2;
        } else if (side2 >= side1 && side2 >= side3) {
            longestSide = side2;
            girth = side1 * 2 + side3 * 2;
        }
        
        if (girth + longestSide > 100 && weight > 70) {
            
            System.out.println("Package is too large and too heavy.");
            
        } else if (girth + longestSide > 100) {
            
            System.out.println("Package is too large.");
            
        } else if (weight > 70) {
            
            System.out.println("Package is too heavy.");
            
        } else {
            
            System.out.println("Package is acceptable.");
            
        }
        
    }
}
